In a world of privilege, a woman's sexual fantasies are granted by a mysterious man. A lush, hardcore work of ultrasex surrounds the awakening of a Diamond Girl.&quot;

That's what the back of the box says, so presumably that's what the professionals at Ninn Worx feel will sell the movie best. Call us crazy, but we're thinking that the extraordinarily beautiful women doing all sorts of wicked deeds might be enough just by themselves. Whatever your opinion, it's undoubtedly good to see Michael Ninn and team return to Europe for a sexual look at the other side of the world.
